import React, { useState } from 'react';

const Navbar = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const [isDarkMode, setIsDarkMode] = useState(false);

  const toggleDarkMode = () => {
    setIsDarkMode(!isDarkMode);
    // Add dark mode class to body
    document.documentElement.classList.toggle('dark');
  };

  return (
    <nav className={`bg-gradient-to-r from-blue-100 via-blue-200 to-blue-300 shadow-lg ${isDarkMode ? 'dark:bg-gradient-to-r dark:from-gray-800 dark:via-gray-900 dark:to-black' : ''}`}>
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center py-4">
          {/* Logo */}
          <div className="flex items-center">
            <span className="text-2xl font-bold text-blue-800 dark:text-white">
              Bottle Shop
            </span>
          </div>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8">
            <a href="/" className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white transition duration-300">
              Home
            </a>
            <a href="/shop" className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white transition duration-300">
              Shop
            </a>
            <a href="/about" className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white transition duration-300">
              About
            </a>
            <a href="/contact" className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white transition duration-300">
              Contact
            </a>
          </div>

          {/* Dark Mode, Login, and Signup Buttons */}
          <div className="hidden md:flex items-center space-x-4">
            {/* Dark Mode Toggle */}
            <button
              onClick={toggleDarkMode}
              className="p-2 rounded-full hover:bg-blue-200 dark:hover:bg-gray-700 transition duration-300"
            >
              {isDarkMode ? (
                // Sun icon for light mode
                <svg className="w-6 h-6 text-yellow-500" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 3v1m0 16v1m9-9h-1M4 12H3m15.364 6.364l-.707-.707M6.343 6.343l-.707-.707m12.728 0l-.707.707M6.343 17.657l-.707.707M16 12a4 4 0 11-8 0 4 4 0 018 0z" />
                </svg>
              ) : (
                // Moon icon for dark mode
                <svg className="w-6 h-6 text-gray-700" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M20.354 15.354A9 9 0 018.646 3.646 9.003 9.003 0 0012 21a9.003 9.003 0 008.354-5.646z" />
                </svg>
              )}
            </button>

            {/* Login Button */}
            <a
              href="/login"
              className="px-4 py-2 text-blue-600 hover:text-blue-800 font-medium dark:text-blue-400 dark:hover:text-blue-300 transition duration-300"
            >
              Login
            </a>

            {/* Signup Button */}
            <a
              href="/signup"
              className="px-4 py-2 bg-blue-600 text-white rounded-full hover:bg-blue-700 font-medium transition duration-300"
            >
              Sign Up
            </a>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden flex items-center">
            <button
              onClick={toggleDarkMode}
              className="p-2 mr-2 rounded-full hover:bg-blue-200 dark:hover:bg-gray-700 transition duration-300"
            >
              {isDarkMode ? (
                <svg className="w-6 h-6 text-yellow-500" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 3v1m0 16v1m9-9h-1M4 12H3m15.364 6.364l-.707-.707M6.343 6.343l-.707-.707m12.728 0l-.707.707M6.343 17.657l-.707.707M16 12a4 4 0 11-8 0 4 4 0 018 0z" />
                </svg>
              ) : (
                <svg className="w-6 h-6 text-gray-700" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M20.354 15.354A9 9 0 018.646 3.646 9.003 9.003 0 0012 21a9.003 9.003 0 008.354-5.646z" />
                </svg>
              )}
            </button>
            <button
              onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
              className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white focus:outline-none"
            >
              <svg className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                {isMobileMenuOpen ? (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                ) : (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
                )}
              </svg>
            </button>
          </div>
        </div>

        {/* Mobile Menu */}
        {isMobileMenuOpen && (
          <div className="md:hidden pb-4">
            <div className="flex flex-col space-y-2">
              <a href="/" className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white px-3 py-2">
                Home
              </a>
              <a href="/shop" className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white px-3 py-2">
                Shop
              </a>
              <a href="/about" className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white px-3 py-2">
                About
              </a>
              <a href="/contact" className="text-gray-700 hover:text-blue-800 dark:text-gray-200 dark:hover:text-white px-3 py-2">
                Contact
              </a>
              <div className="border-t border-gray-300 dark:border-gray-700 my-2"></div>
              <a href="/login" className="text-blue-600 hover:text-blue-800 dark:text-blue-400 dark:hover:text-blue-300 px-3 py-2">
                Login
              </a>
              <a href="/signup" className="bg-blue-600 text-white rounded-full px-3 py-2 text-center hover:bg-blue-700 transition duration-300">
                Sign Up
              </a>
            </div>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
